-- ----------------------------
-- Table structure for `article`
-- ----------------------------
DROP TABLE IF EXISTS `article`;
CREATE TABLE `article` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '文章自增ID号',
  `create_time` datetime NOT NULL,
  `modify_time` datetime DEFAULT NULL,
  `version` bigint(20) DEFAULT NULL,
  `article_name` varchar(128) DEFAULT NULL COMMENT '文章名称',
  `article_ip` varchar(15) DEFAULT NULL COMMENT '发布IP',
  `article_click` int(10) DEFAULT '0' COMMENT '查看人数',
  `sort_article_id` bigint(20) DEFAULT NULL COMMENT '所属分类',
  `member_id` bigint(20) DEFAULT NULL COMMENT '所属用户ID',
  `article_type` int(13) DEFAULT '1' COMMENT '文章的模式:0为私有，1为公开，2为仅好友查看',
  `article_keyword` varchar(128) DEFAULT '' COMMENT '文章关键字',
  `article_content` text COMMENT '文章内容',
  `article_up` tinyint(3) DEFAULT '0' COMMENT '是否置顶:0为否，1为是',
  `article_support` tinyint(3) DEFAULT '0' COMMENT '是否博主推荐:0为否，1为是',
  `pictures` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=109 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of article
-- ----------------------------

