-- Table structure for `member`
-- ----------------------------
DROP TABLE IF EXISTS `member`;
CREATE TABLE `member` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '会员表',
  `create_time` datetime NOT NULL,
  `modify_time` datetime DEFAULT NULL,
  `version` bigint(20) NOT NULL,
  `member_name` varchar(50) DEFAULT NULL COMMENT '用户名',
  `password` varchar(40) DEFAULT NULL COMMENT '密码',
  `status` varchar(2) NOT NULL COMMENT '状态 1 为可用',
  `telephone` varchar(20) DEFAULT NULL COMMENT '电话号码',
  `qq_openid` varchar(32) DEFAULT NULL COMMENT 'QQid',
  `nickname` varchar(32) DEFAULT NULL COMMENT '昵称',
  `salt` varchar(10) DEFAULT NULL COMMENT '加密盐',
  `amount` double(20,0) DEFAULT NULL COMMENT '金额',
  `score` int(13) DEFAULT NULL COMMENT '积分',
  `sex` varchar(6) NOT NULL COMMENT '用户性别',
  `qq` varchar(15) NOT NULL COMMENT '用户QQ号码',
  `email` varchar(64) NOT NULL COMMENT '用户EMAIL地址',
  `address` varchar(255) NOT NULL COMMENT '用户地址',
  `mark` int(13) NOT NULL COMMENT '用户积分',
  `rank_id` int(13) NOT NULL COMMENT '用户等级',
  `last_login_ip` varchar(15) NOT NULL COMMENT '用户上一次登录IP地址',
  `birthday` int(13) NOT NULL COMMENT '用户生日',
  `description` varchar(255) NOT NULL COMMENT '自我描述',
  `image_url` varchar(255) NOT NULL COMMENT '用户头像存储路径',
  `school` varchar(255) NOT NULL COMMENT '毕业学校',
  `register_ip` varchar(15) NOT NULL COMMENT '用户注册时IP地址',
  `power` varchar(4) DEFAULT NULL COMMENT '拥有权限',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

